import React from 'react'
import {Row, Col} from 'react-bootstrap';
import logo from '../../assets/img/logo_compuesto.png'
import InboxIcon from '@material-ui/icons/MoveToInbox';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import MailIcon from '@material-ui/icons/Mail';
import Divider from '@material-ui/core/Divider';

export const Menu = () => {

    return (
        <div>
            <img src={logo} alt="idiky Logo" width="70%"  style={{padding:"2%", display: "block", marginLeft:"auto", marginRight:"auto"}} />
            <Divider />
            <List>
                {['Residentes', 'Colaboradores', 'Cobros', 'Zonas Comunes', 'Reuniones', 'Calendario', 'Seguridad', 'Incentivos', 'Documentos', 'Votaciones'].map((text, index) => (
                <ListItem button key={text}>
                    <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon>
                    <ListItemText primary={text} />
                </ListItem>
                ))}
            </List>
            <Divider />
            <List>
                {['Redactar', 'Mensajes', 'Eliminados'].map((text, index) => (
                <ListItem button key={text}>
                    <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon>
                    <ListItemText primary={text} />
                </ListItem>
                ))}
            </List>
        </div>
    )
}
